function GetDetails(n,t,i,r,u,f){var e=GetSearchParam(n,t,i,r,u,f==undefined?0:f);HttpPost(`/RestorePropertyReport/GetDetails`,"html",e,function(n){$("#LoadReportView").html("");$("#LoadReportView").html(n)})}function GetSearchParam(n,t,i,r,u,f){return{name:"test",pageSize:parseInt(t),pageNumber:parseInt(n),departmentId:parseInt(i),zoneId:parseInt(r),divisionId:parseInt(u),inventoriedId:parseInt($("#InventoriedInId").val()),classificationOfLandId:parseInt($("#ClassificationOfLandId").val()),plannedUnplannedLand:$("#PlannedUnplannedLand").val(),Id:parseInt(f)}}function onPaging(n){var t=$("#DepartmentId option:selected").val(),i=$("#ZoneId option:selected").val(),r=$("#DivisionId option:selected").val(),u=$("#Id option:selected").val();GetDetails(parseInt(n),parseInt(currentPageSize),t,i,r,u);currentPageNumber=n}function onChangePageSize(n){var t=$("#DepartmentId option:selected").val(),i=$("#ZoneId option:selected").val(),r=$("#DivisionId option:selected").val(),u=$("#Id option:selected").val();GetDetails(parseInt(currentPageNumber),parseInt(n),t,i,r,u);currentPageSize=n}function GetZoneList(n){HttpGet(`/RestorePropertyReport/GetZoneList/?departmentId=${n}`,"json",function(n){for(var i='<option value="0">All<\/option>',t=0;t<n.length;t++)i=i+"<option value="+n[t].id+">"+n[t].name+"<\/option>";$("#ZoneId").html(i)})}function GetDivisionList(n){HttpGet(`/RestorePropertyReport/GetDivisionList/?zoneId=${n}`,"json",function(n){for(var i='<option value="0">All<\/option>',t=0;t<n.length;t++)i=i+"<option value="+n[t].id+">"+n[t].name+"<\/option>";$("#DivisionId").html(i)})}function GetLocalityList(n){HttpGet(`/RestorePropertyReport/GetLocalityList/?divisionId=${n}`,"json",function(n){for(var i='<option value="0">All<\/option>',t=0;t<n.length;t++)i=i+"<option value="+n[t].id+">"+n[t].name+"<\/option>";$("#LocalityId").html(i)})}var currentPageNumber=1,currentPageSize=10;$(document).ready(function(){$("#btnGenerate").click(function(){var n=$("#DepartmentId option:selected").val(),t=$("#ZoneId option:selected").val(),i=$("#DivisionId option:selected").val(),r=$("#Id option:selected").val();GetDetails(currentPageNumber,currentPageSize,n,t,i,r)});$(".linkdisabled").click(function(){return!1})});